Superman #21
&quot;The Supergirl Saga&quot; part 1! Who is this new Supergirl? Where did she come from? What is the secret of her powers? And what does Lex Luthor have to do with all this? Continued in ADVENTURES OF SUPERMAN #444.

Superman #22
&quot;The Supergirl Saga&quot; part 3, continued from ADVENTURES OF SUPERMAN #444. When Superman encounters a trio of powerful villains who've murdered on a planetary level, will he do the unthinkable? Can the Last Son make the decision to become judge, jury, and executioner?

